)c([ReportDefinitionId],[ReportName],[Content]))
merge	[TOneWhS_Billing].[ReportDefinition] as t
using	cte_data as s
on		1=1 and t.[ReportDefinitionId] = s.[ReportDefinitionId]
when matched then
	update set
	[ReportName] = s.[ReportName],[Content] = s.[Content]
when not matched by target then
	insert([ReportDefinitionId],[ReportName],[Content])
	values(s.[ReportDefinitionId],s.[ReportName],s.[Content]);
set identity_insert [TOneWhS_Billing].[ReportDefinition] off;
----------------------------------------------------------------------------------------------------

end
