)c([ID],[OldID],[Name],[Title],[Details]))
merge	[genericdata].[DataTransformationDefinition] as t
using	cte_data as s
on		1=1 and t.[ID] = s.[ID]
when matched then
	update set
	[OldID] = s.[OldID],[Name] = s.[Name],[Title] = s.[Title],[Details] = s.[Details]
when not matched by target then
	insert([ID],[OldID],[Name],[Title],[Details])
	values(s.[ID],s.[OldID],s.[Name],s.[Title],s.[Details]);
----------------------------------------------------------------------------------------------------
end

