)c([ID],[OldID],[TableId],[ItemType],[Name],[Title],[Config]))
merge	[Analytic].[AnalyticItemConfig] as t
using	cte_data as s
on		1=1 and t.[ID] = s.[ID]
when matched then
	update set
	[OldID] = s.[OldID],[TableId] = s.[TableId],[ItemType] = s.[ItemType],[Name] = s.[Name],[Title] = s.[Title],[Config] = s.[Config]
when not matched by target then
	insert([ID],[OldID],[TableId],[ItemType],[Name],[Title],[Config])
	values(s.[ID],s.[OldID],s.[TableId],s.[ItemType],s.[Name],s.[Title],s.[Config]);
----------------------------------------------------------------------------------------------------
end


